 INSERT INTO srdb.assessment VALUES('AFSC-REYEROCKGA-1974-2007-MELNYCHUK', 'AFSC', 'REYEROCKGA', 'MELNYCHUK', '2009-04-23', '2011-06-24 12:23:03', '1974-2007', 'http://www.afsc.noaa.gov/refm/docs/2008/GOArougheye.pdf', 'Kalei Shotwell', 'most time series values provided by Dana Hanselman (pers. Comm.); they were in the assessment only in figures', '', 1, 1, 'AD-CAM', '(1) The rougheye rockfish complex also includes blackspotted rockfish, Sebastes melanostictus, in both the catch and in the assessment. These two species were only recently distinguished, so have been treated as one in this time series; (2) The 2008 report was just an update. A full assessment was done in 2007, filename AFSC-RYEROCKGA-2007-Rougheye rockfish GA.pdf', '../spreadsheets/MELNYCHUK-REYEROCKGA-2008-editedDR.xls', '999') ; 
